import { useEffect } from 'react';
import Projects from './Projects';
import { useHistory } from 'react-router-dom';

const AboutMe = () => {
  let history = useHistory ();

 const callaboutpage = () => {
try {
   const res = fetch('/aboutme', {
      method:"GET",
      header:{
        Accept:"application/json",
        "COntent-Type": "application/json"
      },
      credentials:"include"
   });

  const data =  res.json()
  if(!res.status === 200){
    const error = new Error(res.error )
    throw error;
  }


} catch (error) {
  console.log(error)
  history.push ('/login');

  
}
 }


 useEffect(() => {
   callaboutpage(); 
 
   return () => {
      
   }
 }, [])
 
   
  return (
    <div>
        <Projects />
    </div>
  )
}

export default AboutMe;
